INSERT INTO `additional_information_book` (`id_book`, `book_discripthion`, `book_img`) VALUES
	(89, 'Ханс Кри́стиан А́ндерсен (в русском языке общепринятым произношением и написанием является Ганс Христиан, дат. Hans Christian Andersen [ˈhanˀs ˈkʁæsdjan ˈɑnɐsn̩]; 2 апреля 1805 года, Оденсе, Датско-норвежская уния — 4 августа 1875 года, Копенгаген, Дания) — датский прозаик и поэт, автор всемирно известных сказок для детей и взрослых: «Гадкий утёнок», «Новое платье короля», «Дюймовочка», «Стойкий оловянный солдатик», «Принцесса на горошине», «Оле Лукойе», «Снежная королева» и многих других.', _binary );
INSERT INTO `additional_information_book` (`id_book`, `book_discripthion`, `book_img`) VALUES
	(90, 'Этот роман на сегодняшний день является самой читаемой и переводимой книгой современного африканского писателя. За него писатель в 2007 году получил Международную Букеровскую премию. В романе описан приход европейцев на африканскую землю и его разрушительные последствия.', _binary ),
	(95, 'Unfortunately there is no description for this book.', _binary ),
	(96, '«Миссис Дэллоуэй» — четвёртый роман английской писательницы Вирджинии Вулф, опубликованный 14 мая 1925 года. Повествует об одном дне вымышленной героини Клариссы Дэллоуэй, светской дамы пост-военной Англии. Один из самых известных романов писательницы. Русский перевод выполнен Е.А. Суриц. В октябре 2005 года роман "Миссис Дэллоуэй" вошел в список 100 лучших англоязычных романов, написанных после 1923 года, по версии Times.', _binary ),
	(102, '«Фа́уст» — философская драма для чтения, которая считается главным трудом Иоганна Вольфганга Гёте. Содержит наиболее известный вариант легенды о докторе Фаусте.', _binary ),
	(370, 'fgzgfzgdfg', _binary );
